import React from "react";

class MyLinegraph extends React.Component {
  
render() {
  
    return (
      <div class="col-md-6">
            <div class="panel panel-default">
                <div class="panel-heading">
                    <h3>Multiple Line Series</h3>
                </div>
                <div id="chart2" class="panel-body">
                </div>
            </div>
        </div>
    );
  }
}

export default MyLinegraph;
